<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8"/>
<meta name="viewport" content="width=device-width,initial-scale=1"/>
<title>OCNJ Rental Map ‚Äî Competitive Analysis</title>
<style>
:root {
  --ocean:#0a3d5c; --mid:#1a6b96; --light:#4db8e8; --coral:#e8604a;
  --sand:#f5e9d0; --gray:#7a8c99; --black:#1a2b36;
}
* { margin:0; padding:0; box-sizing:border-box; }
body {
  font-family:-apple-system,BlinkMacSystemFont,'Segoe UI',Roboto,sans-serif;
  background:#f8fafb; color:var(--black);
}

/* Header */
.header {
  background:var(--ocean); color:white; padding:20px 30px;
  box-shadow:0 2px 12px rgba(10,61,92,0.15);
}
.header h1 { font-size:1.6rem; margin-bottom:5px; }
.header .subtitle { font-size:0.9rem; opacity:0.9; }
.back-link {
  display:inline-block; margin-top:12px; color:var(--light);
  text-decoration:none; font-size:0.9rem;
}
.back-link:hover { text-decoration:underline; }

/* Main Layout */
.container { max-width:1400px; margin:0 auto; padding:30px 20px; }

/* Property Card */
.property-card {
  background:white; border-radius:12px; padding:24px;
  box-shadow:0 2px 16px rgba(10,61,92,0.1); margin-bottom:30px;
  display:flex; gap:24px; align-items:start;
}
.property-card img {
  width:200px; height:150px; object-fit:cover; border-radius:8px;
  flex-shrink:0;
}
.property-info { flex:1; }
.property-info h2 { font-size:1.4rem; color:var(--ocean); margin-bottom:8px; }
.property-specs {
  display:flex; gap:20px; margin:12px 0; font-size:0.95rem; color:var(--gray);
}
.property-stats {
  display:flex; gap:30px; margin-top:16px; padding-top:16px;
  border-top:1px solid #e5e7eb;
}
.stat { display:flex; flex-direction:column; }
.stat-label { font-size:0.75rem; color:var(--gray); text-transform:uppercase;
  letter-spacing:0.05em; margin-bottom:4px; }
.stat-value { font-size:1.1rem; font-weight:600; color:var(--ocean); }

/* Section Headers */
.section-header {
  font-size:1.3rem; color:var(--ocean); margin:40px 0 20px;
  padding-bottom:10px; border-bottom:2px solid var(--light);
}

/* Mobile Responsive */
@media (max-width: 768px) {
  .header { padding:16px 20px; }
  .header h1 { font-size:1.3rem; }
  .header .subtitle { font-size:0.85rem; }
  .container { padding:20px 16px; }
  .section-header { font-size:1.15rem; margin:30px 0 16px; }
  
  .property-card { flex-direction:column; padding:16px; }
  .property-card img { width:100%; max-width:300px; margin:0 auto; }
  .property-specs { flex-wrap:wrap; gap:12px; }
  .property-stats { flex-direction:column; gap:16px; }
  
  .comp-item { padding:16px; }
  .comp-header { flex-direction:column; gap:8px; align-items:start; }
  .comp-rank { font-size:1.2rem; }
  .comp-address { font-size:0.95rem; }
  
  .comparison-table { overflow-x:auto; -webkit-overflow-scrolling:touch; }
  table { min-width:600px; font-size:0.85rem; }
  thead th { padding:10px 8px; font-size:0.8rem; }
  tbody td { padding:10px 8px; }
  
  .recommendations { padding:16px; }
  .rec-item { padding:12px; font-size:0.9rem; }
  .summary { padding:16px; font-size:0.95rem; }
}

/* Comp Set List */
.comp-list { display:flex; flex-direction:column; gap:16px; }
.comp-item {
  background:white; border-radius:8px; padding:20px;
  box-shadow:0 1px 8px rgba(10,61,92,0.08);
  border-left:4px solid var(--mid);
}
.comp-header { display:flex; justify-content:space-between; align-items:start; margin-bottom:12px; }
.comp-rank { font-size:1.4rem; font-weight:700; color:var(--mid); margin-right:12px; }
.comp-address { font-size:1.05rem; color:var(--ocean); font-weight:600; flex:1; }
.comp-score { font-size:0.85rem; color:var(--gray); background:#f1f5f9;
  padding:4px 10px; border-radius:12px; }
.comp-specs { font-size:0.9rem; color:var(--gray); margin-bottom:8px; }
.comp-price { font-size:1.05rem; font-weight:600; color:var(--ocean); margin-bottom:10px; }
.comp-diff { font-size:0.9rem; margin-left:8px; }
.comp-diff.higher { color:var(--coral); }
.comp-diff.lower { color:#059669; }
.comp-link {
  display:inline-block; margin-top:8px; padding:8px 14px;
  background:var(--ocean); color:white; text-decoration:none;
  border-radius:6px; font-size:0.85rem; font-weight:600;
  transition:background 0.2s;
}
.comp-link:hover { background:var(--mid); }

/* Comparison Table */
.comparison-table {
  background:white; border-radius:12px; padding:24px;
  box-shadow:0 2px 16px rgba(10,61,92,0.1); margin-bottom:30px;
  overflow-x:auto;
}
table {
  width:100%; border-collapse:collapse; font-size:0.9rem;
}
thead th {
  background:var(--ocean); color:white; padding:12px; text-align:left;
  font-weight:600; font-size:0.85rem; text-transform:uppercase;
  letter-spacing:0.05em;
}
tbody td {
  padding:12px; border-bottom:1px solid #e5e7eb;
}
tbody tr:hover { background:#f8fafb; }
.week-cell { font-weight:600; color:var(--ocean); }
.price-cell { text-align:right; }
.diff-cell { text-align:right; font-weight:600; }
.diff-positive { color:#059669; }
.diff-negative { color:var(--coral); }
.rank-cell { text-align:center; font-size:0.85rem; color:var(--gray); }
.competitive { background:#dcfce7; }
.overpriced { background:#fee2e2; }
.week-cell a {
  color:var(--ocean); font-weight:600; text-decoration:none;
  display:block; padding:4px 0;
}
.week-cell a:hover {
  text-decoration:underline; color:var(--mid);
}

/* Recommendations */
.recommendations {
  background:white; border-radius:12px; padding:24px;
  box-shadow:0 2px 16px rgba(10,61,92,0.1);
}
.rec-item {
  padding:16px; margin-bottom:12px; border-radius:8px;
  border-left:4px solid;
}
.rec-item.info { background:#eff6ff; border-color:#3b82f6; }
.rec-item.warning { background:#fef3c7; border-color:#f59e0b; }
.rec-item.success { background:#dcfce7; border-color:#059669; }
.summary {
  margin-top:24px; padding:20px; background:#f8fafb; border-radius:8px;
  border-left:4px solid var(--mid); font-size:1.05rem; font-weight:500;
}

/* Loading State */
.loading {
  text-align:center; padding:60px; color:var(--gray);
}
.error {
  background:#fee2e2; color:#991b1b; padding:20px; border-radius:8px;
  border-left:4px solid #dc2626;
}
</style>
</head>

// ‚îÄ‚îÄ UTILITY FUNCTIONS ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function haversineDistance(lat1, lon1, lat2, lon2) {
  const R = 6371000; // Earth radius in meters
  const œÜ1 = lat1 * Math.PI / 180;
  const œÜ2 = lat2 * Math.PI / 180;
  const ŒîœÜ = (lat2 - lat1) * Math.PI / 180;
  const ŒîŒª = (lon2 - lon1) * Math.PI / 180;
  const a = Math.sin(ŒîœÜ/2) * Math.sin(ŒîœÜ/2) +
            Math.cos(œÜ1) * Math.cos(œÜ2) *
            Math.sin(ŒîŒª/2) * Math.sin(ŒîŒª/2);
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
  return R * c;
}

function pointToSegmentDistance(px, py, ax, ay, bx, by) {
  const abx = bx - ax;
  const aby = by - ay;
  const apx = px - ax;
  const apy = py - ay;
  const abLenSq = abx*abx + aby*aby;
  if (abLenSq === 0) return haversineDistance(py, px, ay, ax);
  const t = Math.max(0, Math.min(1, (apx*abx + apy*aby) / abLenSq));
  const projLat = ay + t * aby;
  const projLon = ax + t * abx;
  return haversineDistance(py, px, projLat, projLon);
}

function distanceToBeach(lat, lon) {
  if (!coastline || coastline.length < 2) return null;
  let minDist = Infinity;
  for (let i = 0; i < coastline.length - 1; i++) {
    const [lat1, lon1] = coastline[i];
    const [lat2, lon2] = coastline[i + 1];
    const dist = pointToSegmentDistance(lon, lat, lon1, lat1, lon2, lat2);
    minDist = Math.min(minDist, dist);
  }
  return minDist;
}

function getZone(lat) {
  if (lat <= 39.264) return 'North End';
  if (lat <= 39.276) return 'Mid-Town';
  return 'South End';
}

function calculateSimilarity(subject, comp) {
  let score = 0;
  
  // Beds/Baths (40 points)
  const bedsDiff = Math.abs((subject.beds || 0) - (comp.beds || 0));
  const bathsDiff = Math.abs((subject.baths || 0) - (comp.baths || 0));
  if (bedsDiff === 0 && bathsDiff === 0) score += 40;
  else if (bedsDiff <= 1 && bathsDiff <= 1) score += 25;
  
  // Location proximity (35 points)
  const dist = haversineDistance(subject.lat, subject.lng, comp.lat, comp.lng);
  if (dist < 200) score += 35;
  else if (dist < 400) score += 25;
  else if (dist < 600) score += 15;
  
  // Beach distance similarity (25 points)
  if (subject.beachDist && comp.beachDist) {
    const beachDiff = Math.abs(subject.beachDist - comp.beachDist);
    if (beachDiff < 50) score += 25;
    else if (beachDiff < 100) score += 18;
    else if (beachDiff < 150) score += 10;
  }
  
  return score;
}

// ‚îÄ‚îÄ MAIN APP ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function runAnalysis() {
  console.log('runAnalysis() started');
  
  const urlParams = new URLSearchParams(window.location.search);
  const listingId = urlParams.get('id');
  console.log('Listing ID from URL:', listingId);
  
  if (!listingId) {
    console.log('No listing ID - showing error');
    document.getElementById('app').innerHTML = `
      <div class="error">
        <strong>No property selected</strong><br>
        Please select a property from the map to view its competitive analysis.
      </div>`;
    return;
  }
  
  // Find the subject property
  console.log('Searching for property with listId:', listingId);
  console.log('Total properties:', properties.length);
  const subject = properties.find(p => p.listId === listingId);
  console.log('Found subject property:', subject ? subject.address : 'NOT FOUND');
  
  if (!subject) {
    console.log('Property not found - showing error');
    document.getElementById('app').innerHTML = `
      <div class="error">
        <strong>Property not found</strong><br>
        Listing ID "${listingId}" does not exist in the current dataset.
      </div>`;
    return;
  }
  
  console.log('Calculating beach distances...');
  // Calculate beach distances for all properties
  properties.forEach(p => {
    if (p.lat && p.lng) {
      p.beachDist = distanceToBeach(p.lat, p.lng);
      p.zone = getZone(p.lat);
    }
  });
  
  subject.beachDist = distanceToBeach(subject.lat, subject.lng);
  subject.zone = getZone(subject.lat);
  console.log('Subject beach distance:', subject.beachDist, 'zone:', subject.zone);
  
  console.log('Finding comps...');
  // Find comps
  const comps = properties
    .filter(p => p.listId !== subject.listId && p.lat && p.lng)
    .map(p => ({ ...p, similarity: calculateSimilarity(subject, p) }))
    .filter(p => p.similarity >= 60 && p.zone === subject.zone)
    .sort((a, b) => b.similarity - a.similarity)
    .slice(0, 10);
  
  console.log('Found comps:', comps.length);
  
  if (comps.length === 0) {
    console.log('No comps found - showing error');
    document.getElementById('app').innerHTML = `
      <div class="error">
        <strong>No comparable properties found</strong><br>
        There are no properties similar enough to "${subject.address}" in the current dataset.
      </div>`;
    return;
  }
  
  // Calculate average prices by week
  const allWeeks = new Set();
  if (subject.weeks) Object.keys(subject.weeks).forEach(w => allWeeks.add(w));
  comps.forEach(c => {
    if (c.weeks) Object.keys(c.weeks).forEach(w => allWeeks.add(w));
  });
  
  console.log('All weeks:', allWeeks.size);
  console.log('Rendering analysis...');
  
  // Render the page
  try {
    renderCompAnalysis(subject, comps, Array.from(allWeeks).sort());
    console.log('Rendering complete!');
  } catch (e) {
    console.error('Error in renderCompAnalysis:', e);
    document.getElementById('app').innerHTML = `
      <div class="error">
        <strong>Rendering Error</strong><br>
        ${e.message}<br><br>
        <pre style="text-align:left;font-size:0.85rem;margin-top:12px;">${e.stack}</pre>
      </div>`;
  }
}

function renderCompAnalysis(subject, comps, weeks) {
  const avgPrice = subject.weeks ? 
    Object.values(subject.weeks).reduce((a,b) => a+b, 0) / Object.values(subject.weeks).length : 0;
  
  const beachDistStr = subject.beachDist ? 
    `${Math.round(subject.beachDist)}m to beach` : 'Beach distance unknown';
  
  // Build property card
  let html = `
    <div class="property-card">
      <img src="${subject.imageUrl || ''}" onerror="this.style.display='none'" alt=""/>
      <div class="property-info">
        <h2>${subject.address}</h2>
        <div class="property-specs">
          <span>${subject.beds || '?'} BR</span>
          <span>${subject.baths || '?'} BA</span>
          <span>${subject.guests || '?'} guests</span>
          <span>üìç ${subject.zone}</span>
          <span>üèñÔ∏è ${beachDistStr}</span>
        </div>
        <div class="property-stats">
          <div class="stat">
            <div class="stat-label">Available Weeks</div>
            <div class="stat-value">${subject.weeks ? Object.keys(subject.weeks).length : 0}</div>
          </div>
          <div class="stat">
            <div class="stat-label">Avg Weekly Price</div>
            <div class="stat-value">$${Math.round(avgPrice).toLocaleString()}</div>
          </div>
        </div>
      </div>
    </div>
    
    <h2 class="section-header">Competitive Set (${comps.length} similar properties)</h2>
    <div class="comp-list">`;
  
  // Build comp list
  comps.forEach((comp, idx) => {
    const compAvg = comp.weeks ? 
      Object.values(comp.weeks).reduce((a,b) => a+b, 0) / Object.values(comp.weeks).length : 0;
    const priceDiff = compAvg - avgPrice;
    const diffPct = avgPrice > 0 ? ((priceDiff / avgPrice) * 100).toFixed(0) : 0;
    const diffClass = priceDiff > 0 ? 'higher' : 'lower';
    const diffSign = priceDiff > 0 ? '+' : '';
    
    html += `
      <div class="comp-item">
        <div class="comp-header">
          <span class="comp-rank">${idx + 1}.</span>
          <span class="comp-address">${comp.address}</span>
          <span class="comp-score">Match: ${comp.similarity}/100</span>
        </div>
        <div class="comp-specs">
          ${comp.beds || '?'} BR ¬∑ ${comp.baths || '?'} BA ¬∑ ${comp.guests || '?'} guests ¬∑ 
          üèñÔ∏è ${comp.beachDist ? Math.round(comp.beachDist) + 'm' : '?'}
        </div>
        <div class="comp-price">
          Avg: $${Math.round(compAvg).toLocaleString()}/week
          <span class="comp-diff ${diffClass}">(${diffSign}${Math.round(Math.abs(priceDiff)).toLocaleString()}, ${diffSign}${diffPct}%)</span>
        </div>
        <a href="${comp.listingUrl}" target="_blank" class="comp-link">View on Berger Realty ‚Üí</a>
      </div>`;
  });
  
  html += `</div>
    <h2 class="section-header">Week-by-Week Pricing Comparison</h2>
    <p style="color:var(--gray);margin-bottom:16px;font-size:0.95rem;">
      Only showing weeks where you have pricing data. Comps without pricing for a week are excluded from that row's average.
      <strong>Click any week</strong> to view it on the map.
    </p>`;
  
  // Build comparison table
  html += `<div class="comparison-table"><table><thead><tr>
    <th>Week</th>
    <th class="price-cell">Your Price</th>
    <th class="price-cell">Comp Avg</th>
    <th class="diff-cell">Difference</th>
    <th class="rank-cell">Your Rank</th>
  </tr></thead><tbody>`;
  
  if (subject.weeks) {
    Object.keys(subject.weeks).sort().forEach(week => {
      const yourPrice = subject.weeks[week];
      const compPrices = comps.map(c => c.weeks?.[week]).filter(p => p);
      
      if (compPrices.length === 0) return;
      
      const compAvg = compPrices.reduce((a,b) => a+b, 0) / compPrices.length;
      const diff = yourPrice - compAvg;
      const diffPct = ((diff / compAvg) * 100).toFixed(0);
      const diffClass = diff > 0 ? 'diff-negative' : 'diff-positive';
      const diffSign = diff > 0 ? '+' : '';
      
      // Calculate rank
      const allPrices = [yourPrice, ...compPrices].sort((a,b) => a - b);
      const rank = allPrices.indexOf(yourPrice) + 1;
      const total = allPrices.length;
      
      const rowClass = Math.abs(diffPct) < 10 ? 'competitive' : (diff > 0 ? 'overpriced' : '');
      
      html += `<tr class="${rowClass}">
        <td class="week-cell"><a href="ocnj-rental-map-final.html?week=${encodeURIComponent(week)}">${week}</a></td>
        <td class="price-cell">$${yourPrice.toLocaleString()}</td>
        <td class="price-cell">$${Math.round(compAvg).toLocaleString()}</td>
        <td class="diff-cell ${diffClass}">${diffSign}$${Math.round(Math.abs(diff)).toLocaleString()} (${diffSign}${diffPct}%)</td>
        <td class="rank-cell">${rank} of ${total}</td>
      </tr>`;
    });
  }
  
  html += `</tbody></table></div>`;
  
  // Add recommendations
  html += `<h2 class="section-header">Recommendations</h2><div class="recommendations">`;
  
  if (subject.weeks) {
    let overpriced = 0;
    let underpriced = 0;
    Object.keys(subject.weeks).forEach(week => {
      const yourPrice = subject.weeks[week];
      const compPrices = comps.map(c => c.weeks?.[week]).filter(p => p);
      if (compPrices.length === 0) return;
      const compAvg = compPrices.reduce((a,b) => a+b, 0) / compPrices.length;
      const diff = yourPrice - compAvg;
      const diffPct = ((diff / compAvg) * 100);
      
      if (diffPct > 15) {
        overpriced++;
        if (overpriced <= 3) {
          html += `<div class="rec-item warning">
            <strong>Week of ${week}:</strong> You're $${Math.round(diff).toLocaleString()} above market ‚Äî 
            consider dropping to $${Math.round(compAvg).toLocaleString()} to stay competitive.
          </div>`;
        }
      } else if (diffPct < -15) {
        underpriced++;
        if (underpriced <= 3) {
          html += `<div class="rec-item success">
            <strong>Week of ${week}:</strong> You're $${Math.round(Math.abs(diff)).toLocaleString()} below market ‚Äî 
            you could raise to $${Math.round(compAvg).toLocaleString()} and still be competitive.
          </div>`;
        }
      }
    });
    
    if (overpriced === 0 && underpriced === 0) {
      html += `<div class="rec-item info">
        <strong>Well-positioned:</strong> Your pricing is competitive across all weeks. 
        You're within 15% of market average throughout the season.
      </div>`;
    }
    
    // Overall summary
    const allDiffs = Object.keys(subject.weeks).map(week => {
      const yourPrice = subject.weeks[week];
      const compPrices = comps.map(c => c.weeks?.[week]).filter(p => p);
      if (compPrices.length === 0) return null;
      const compAvg = compPrices.reduce((a,b) => a+b, 0) / compPrices.length;
      return yourPrice - compAvg;
    }).filter(d => d !== null);
    
    const avgDiff = allDiffs.reduce((a,b) => a+b, 0) / allDiffs.length;
    const percentile = avgDiff > 0 ? 
      Math.round(50 + (avgDiff / avgPrice) * 50) : 
      Math.round(50 - (Math.abs(avgDiff) / avgPrice) * 50);
    
    html += `<div class="summary">
      <strong>SUMMARY:</strong> You're priced at approximately the <strong>${percentile}th percentile</strong> 
      for similar properties. ${
        percentile > 65 ? "You're above average ‚Äî consider whether your premium is justified by location or amenities." :
        percentile < 35 ? "You're below average ‚Äî you may have room to increase prices." :
        "You're competitively priced around the market average."
      }
    </div>`;
  }
  
  html += `</div>`;
  
  document.getElementById('app').innerHTML = html;
}

// Run on load
try {
  runAnalysis();
} catch (e) {
  console.error('ERROR in runAnalysis:', e);
  document.getElementById('app').innerHTML = `
    <div class="error">
      <strong>Analysis Error</strong><br>
      ${e.message}<br><br>
      Check the browser console for details.
    </div>`;
}
